import React from 'react';
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';
import Login from './pages/Login/Login';
import AdminDashboard from './pages/AdminDashboard/AdminDashboard';
import UserDashboard from './pages/UserDashboard/UserDashboard';
import EventList from './pages/EventList/EventList'; // Exemplo de página de eventos acessível ao usuário comum

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Login} />
        <Route path="/admin-dashboard" component={AdminDashboard} />
        <Route path="/user-dashboard" component={UserDashboard} />
        <Route path="/events" component={EventList} /> {/* Exemplo de rota para eventos */}
        <Redirect to="/" /> {/* Redireciona para a página de login se nenhuma rota corresponder */}
      </Switch>
    </Router>
  );
};

export default App;
